    console.log('Starting server on yeoeoooo port 5000');

});

// Add the WebSocket handlers
io.on('connection', function(sock) {

    sock.emit('message', 'Hi, you are connected');

});

setInterval(function() {
    io.sockets.emit('message', 'hi!');
}, 1000);

